import React, { useState, useEffect } from "react";
import axios from "axios";

const SuperAdminDashboard = () => {
  const [users, setUsers] = useState([]);
  const [restaurants, setRestaurants] = useState([]);

  useEffect(() => {
    axios.get("http://localhost:5000/api/users", { headers: { Authorization: localStorage.getItem("token") } }).then((res) => setUsers(res.data));
    axios.get("http://localhost:5000/api/restaurants").then((res) => setRestaurants(res.data));
  }, []);

  return (
    <div>
      <h1>Super Admin Dashboard</h1>

      <h2>Users</h2>
      {users.map((user) => (
        <p key={user._id}>{user.name} - {user.role}</p>
      ))}

      <h2>Restaurants</h2>
      {restaurants.map((restaurant) => (
        <p key={restaurant._id}>{restaurant.name} - {restaurant.cuisine}</p>
      ))}
    </div>
  );
};

export default SuperAdminDashboard;
